import React from 'react'
import './BurgerButton.css'

const BurgerButton = props => {
  return (
    <div className='menu'>
      <img src='../../imgs/menu.png' alt='icon' onMouseDown={e => {props.handleMouseDown(e)}} />
    </div>
  )
}

export default BurgerButton

